import React from 'react';

function SelectedEventList({ selectedEvents, toggleSelectedEvent }) {
  return (
    <div className="selected-event-list">
      <h2>Selected Events</h2>
      <div className="event-cards">
        {selectedEvents.map(event => (
          <div key={event.id} className="event-card selected">
            <div className="event-info">
              <div className="event-name">{event.event_name}</div>
              <div className="event-category">{event.event_category}</div>
              <div className="event-timings">
                {event.start_time} - {event.end_time}
              </div>
            </div>
            <button onClick={() => toggleSelectedEvent(event.id)}>Deselect</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default SelectedEventList;
